column4:
Reglas de invitación 

1. Por cada amigo que invites a registrarse con éxito, puedes obtener 5 monedas de oro de recompensa; 
2. Los amigos invitados inician sesión en la aplicación para rellenar el código de invitación, obtendrás otra recompensa de privilegio vip de 1 día; 
3. Por cada amigo que rellene el código de invitación, podrás obtener el 2% de recompensa en efectivo de la cantidad de recarga de tu amigo; 
4. 20 o más amigos invitados inician sesión en la aplicación rellene el código de invitación, puede obtener la calificación de entrevistar a la dama de honor certificada.

column2:
Personal information protection guidelines:

1. We collect and use information in accordance with the privacy policy, and will not force binding;
2, when only browsing, in order to ensure account login security and information security, we will collect equipment and log information; 
3. Cameras, microphones, storage space, phone numbers, and geographic location information need to be authorized to implement functions or use services;

You can view the full version of the user privacy policy

column3:
Pedoman untuk perlindungan informasi pribadi:

1. Kami mengumpulkan dan menggunakan informasi sesuai dengan kebijakan privasi, dan tidak akan mengikat secara paksa;
2, saat menjelajah saja, untuk memastikan keamanan login akun dan keamanan informasi, kami akan mengumpulkan peralatan dan informasi log; 
3. Kamera, mikrofon, ruang penyimpanan, nomor telepon, dan informasi lokasi geografis perlu diotorisasi untuk menjalankan fungsi atau menggunakan layanan;

Anda dapat melihat versi lengkap dari kebijakan privasi pengguna
